package Tree;import Temp.Temp;import Temp.Label;import java.util.LinkedList;public class ExpCall extends Tree.Stm {  Tree.CALL call;  public ExpCall(Tree.CALL c) {call=c;}  public LinkedList<Tree.Exp1> kids() {return call.kids();}  public Tree.Stm build(LinkedList<Tree.Exp1> kids) {	return new Tree.EXP(call.build(kids));  }  public void accept(IntVisitor v, int d) { v.visit(this, d); }  public void accept(CodeVisitor v) { v.visit(this); }  public <R> R accept(ResultVisitor<R> v) { return v.visit(this); }}   